.keylabels {
    font-family: 'Fredoka', sans-serif;
}
.dcs {
    font-style:normal;
    font-family:'engravers_gothic_fsregular';
    position:relative;
    bottom:.25em;
    right:.12em;
}
.dcs2 {
    font-style:normal;
    font-family:'engravers_gothic_fsregular';
    position:relative;
    bottom:.25em;
    right:.05em;
}
.dl:before {
    content:"||";
    font-style:normal;
    position:relative;
    font-size:.85em;
    bottom:.105em;
}
.mac {
    position:relative;
    right:.85em;
    bottom:.3em;
}
.win {
    position:relative;
    right:.4em;
    top:.7em;
}
.keyborder {
    background:radial-gradient(rgba(0,0,0,.125),rgba(0,0,0,0),rgba(0,0,0,0));
}
#keyboard-bg {
    background:linear-gradient(225deg, #d0ccc9 3.5%, transparent 0%),
               linear-gradient(135deg, #d0ccc9 3.5%, transparent 0%),
               linear-gradient(to bottom, #d0ccc9 2%, #a6a3a1 2%, #d0ccc9 10%, #d0ccc9 22%, transparent 22.5%,
               transparent 91%, #d0ccc9 91.5%, #a6a3a1),
               linear-gradient(135deg, #d0ccc9 7.5%, transparent 8%, transparent 96.25%, #d0ccc9 96.75%),
               linear-gradient(225deg, #d0ccc9 7.5%, transparent 8%, transparent 96.25%, #d0ccc9 96.75%),
               linear-gradient(to right, #d0ccc9 .75%, #535250 1%, transparent 1%, transparent 99%, #535250 99%, #d0ccc9 99.5%),
               linear-gradient(to bottom, #535250 22.5%, #535250 91%)
               #d0ccc9 !important;/*linear-gradient(to right, rgba(0,0,0,.2), rgba(0,0,0,.2)) #d0ccc9 !important;*/
}
